jQuery(document).ready(function(){App.init();$(".cd-panel").addClass("is-visible")});$.backstretch(["/assets/img/bg/bg1.jpg","/assets/img/bg/bg2.jpg","/assets/img/bg/19.jpg"],{fade:1000,duration:7000});function cambio(b){if((b.name=="documento")||(b.name=="documento2")){var c=b.value;var a="";for(i=0;i<c.length;i++){a=a+"*"}$("#documento").val(a);$("#documento").attr("name","documento2");$("#doc").html("<input type='hidden' name='documento' id='docr' value='"+c+"' > ")}}function esta(b){if(b.name=="documento2"){var a=$("#docr").val();if(a!=b.value){$("#documento").val(a);$("#documento").attr("name","documento2")}}}function presiono(b){if(b.name=="documento2"){var a=$("#docr").val();if(a==b.value){cambio(b)}}};